    [],nt"revision_timestamp": "2016-07-27T23:06:05.087560",nt"name": "oregon-islands-invasive-species-removal-at-coquille-point-coastal-bluff",nt"isopen":
    false,nt"url": null,nt"notes": "The proposed project is a part of the Refuge
    invasive species management program and will help achieve goals and priority habitats
    objectives identified in the Refuge CCP. The project will remove invasive species
    on over 19 acres focusing on gorse (Ulex europaeus), Scotch Broom (Cytisus scoparius)
    and Himalayan Blackberry (Rubus bifrons) species on a coastal bluff at Coquille
    Point headland. Gorse is an invasive European plant that is hardy, fast growing
    and covered in inch-long spines that make thickets virtually impassible. Gorse produces
    a high oil content that is very flammable and a potential danger to Refuge neighborsu2019
    homes. All of the funds would be obligated in FY16. Most of the work will take place
    in FY 16 by a contractor to remove and mulch invasive species on site, and then
    follow up in FY17 to herbicide any new sprouts.",nt"license_title": "License
